CREATE PROCEDURE [dbo].[aspmnxSP_RecreateRolesTable]
AS
BEGIN 
-- BEGINNING TRANSACTION DATA
BEGIN TRANSACTION _DATA_

SET NOEXEC OFF
SET IMPLICIT_TRANSACTIONS OFF
SET ANSI_WARNINGS ON
SET XACT_ABORT ON
SET ARITHABORT ON
SET NOCOUNT ON
SET NUMERIC_ROUNDABORT OFF
SET CONCAT_NULL_YIELDS_NULL ON
SET QUOTED_IDENTIFIER ON
SET ANSI_NULLS ON
SET ANSI_PADDING ON


-- Foreign Key Constraint Disable's for Table: [dbo].[aspnet_Roles]
--ALTER TABLE [dbo].[aspnet_Roles] NOCHECK CONSTRAINT [FK__aspnet_Ro__Appli__1D07F587]

-- Foreign Key Constraint Disable's for Table: [dbo].[aspnet_Roles]
--Print 'Foreign Key Constraint Disable''s for Table: [dbo].[aspnet_Roles]'
-- YS check the name of CONSTRAINT first
DECLARE @TForeignConstraint Table (K_Table nvarchar(128),fk_column nvarchar(128),PK_Table nvarchar(128),Pk_column nvarchar(128),Constraint_Name nvarchar(128))
SELECT
K_Table = FK.TABLE_NAME,
FK_Column = CU.COLUMN_NAME,
PK_Table = PK.TABLE_NAME,
PK_Column = PT.COLUMN_NAME,
Constraint_Name = C.CONSTRAINT_NAME
FROM INFORMATION_SCHEMA.REFERENTIAL_CONSTRAINTS C
INNER JOIN INFORMATION_SCHEMA.TABLE_CONSTRAINTS FK ON C.CONSTRAINT_NAME = FK.CONSTRAINT_NAME
INNER JOIN INFORMATION_SCHEMA.TABLE_CONSTRAINTS PK ON C.UNIQUE_CONSTRAINT_NAME = PK.CONSTRAINT_NAME
INNER JOIN INFORMATION_SCHEMA.KEY_COLUMN_USAGE CU ON C.CONSTRAINT_NAME = CU.CONSTRAINT_NAME
INNER JOIN (
SELECT i1.TABLE_NAME, i2.COLUMN_NAME
FROM INFORMATION_SCHEMA.TABLE_CONSTRAINTS i1
INNER JOIN INFORMATION_SCHEMA.KEY_COLUMN_USAGE i2 ON i1.CONSTRAINT_NAME = i2.CONSTRAINT_NAME
WHERE i1.CONSTRAINT_TYPE = 'PRIMARY KEY'
) PT ON PT.TABLE_NAME = PK.TABLE_NAME
WHERE PK.TABLE_NAME='aspnet_Roles' or FK.TABLE_NAME='aspnet_Roles'
IF @@ROWCOUNT <> 0
BEGIN
	DECLARE @K_Table nvarchar(128),@fk_column nvarchar(128),@PK_Table nvarchar(128),@Pk_column nvarchar(128),@Constraint_Name nvarchar(128), @SqlCommand nvarchar(max)
	DECLARE SysCursor CURSOR LOCAL FAST_FORWARD
	FOR
		SELECT K_Table,fk_column,PK_Table,Pk_column,Constraint_Name
	from @TForeignConstraint T
	OPEN SysCursor;
	FETCH NEXT FROM SysCursor INTO @K_Table,@fk_column,@PK_Table,@Pk_column,@Constraint_Name ;
	WHILE @@FETCH_STATUS = 0
	BEGIN
		SELECT @SqlCommand=' ALTER TABLE '+@K_Table+' NOCHECK CONSTRAINT '+@Constraint_Name
		execute sp_executesql @SqlCommand
		FETCH NEXT FROM SysCursor INTO @K_Table,@fk_column,@PK_Table,@Pk_column,@Constraint_Name ;
	END --WHILE @@FETCH_STATUS = 0
	CLOSE SysCursor;
	DEALLOCATE SysCursor;
END -- IF @@ROWCOUNT<>0
---ALTER TABLE ' [dbo].[aspnet_Roles] NOCHECK CONSTRAINT [FK__aspnet_Ro__Appli__1D07F587]
-- Deleting from table: aspnet_Roles
--PRINT 'Deleting from table: aspnet_Roles'
DELETE FROM [dbo].[aspnet_Roles]
--- YS find applicationid
declare @ApplicationId uniqueidentifier
select @ApplicationId= ApplicationId from aspnet_Applications where LoweredApplicationName ='manex'


-- Insert scripts for table: aspnet_Roles

-- Foreign Key Constraint Enable's for Table: [dbo].[aspnet_Roles]
--ALTER TABLE [dbo].[aspnet_Roles] CHECK CONSTRAINT [FK__aspnet_Ro__Appli__1D07F587]

-- Foreign Key Constraint Enable's for Table: [dbo].[aspnet_Roles]
--Print 'Foreign Key Constraint Enable''s for Table: [dbo].[aspnet_Roles]'
--- YS automate
--ALTER TABLE [dbo].[aspnet_Roles] CHECK CONSTRAINT [FK__aspnet_Ro__Appli__1D07F587]
DECLARE SysCursor CURSOR LOCAL FAST_FORWARD
FOR
SELECT K_Table,fk_column,PK_Table,Pk_column,Constraint_Name
from @TForeignConstraint T
OPEN SysCursor;
FETCH NEXT FROM SysCursor INTO @K_Table,@fk_column,@PK_Table,@Pk_column,@Constraint_Name ;
WHILE @@FETCH_STATUS = 0
BEGIN
	SELECT @SqlCommand=' ALTER TABLE '+@K_Table+' CHECK CONSTRAINT '+@Constraint_Name
	execute sp_executesql @SqlCommand
	FETCH NEXT FROM SysCursor INTO @K_Table,@fk_column,@PK_Table,@Pk_column,@Constraint_Name ;
END --WHILE @@FETCH_STATUS = 0
CLOSE SysCursor;
DEALLOCATE SysCursor;
-- COMMITTING TRANSACTION DATA
--PRINT 'Committing transaction DATA'
IF @@TRANCOUNT>0
	COMMIT TRANSACTION _DATA_
	SET NOEXEC OFF
END




